import React, { useState } from "react";
import "./Home.css";
import { Link, Routes, Route, useNavigate } from 'react-router-dom';
import Personality from "./Personality";

const Home = () => {
  const navigate = useNavigate();
  const [selectedHoroscope, setSelectedHoroscope] = useState('');

  function handleHoroscopeSelect(horoscope) {
    setSelectedHoroscope(horoscope);
  }
  function handleChange(){
    return(
    <div className="dropdown-horoscope">
    <ul>
      <h3>Your Horoscope</h3>
      <DropdownItem text="Aries" />
      <DropdownItem text="Taurus" />
      <DropdownItem text="Gemini" />
      <DropdownItem text="Cancer" />
      <DropdownItem text="Leo" />
      <DropdownItem text="Virgo" />
      <DropdownItem text="Libra" />
      <DropdownItem text="Scorpio" />
      <DropdownItem text="Sagittarius" />
      <DropdownItem text="Capricorn" />
      <DropdownItem text="Aquarius" />
      <DropdownItem text="Pisces" />
    </ul>
  </div>
  )}
  function handleClick(event) {
    event.preventDefault();
    navigate("/personality");
    console.log(selectedHoroscope);
  }

  function DropdownItem(props) {
    return (
      <li className="dropdownItem" onClick={() => handleHoroscopeSelect(props.text)}>
        <span>{props.text}</span>
      </li>
    );
  }

  return (
    <React.Fragment>
      <Link to="/personality"></Link>
      <Routes>
        <Route path="/personality" element={<Personality />} />
      </Routes>
      <div className='main-container'>
        <span className='text'>Find your match</span>
        <div className='wrapper-2'>
          <span className='text-2'>
            We match compatibility based on:
            <br />
            Personality
            <br />
            Aestheticism
            <br />
            Lifestyle
          </span>
        </div>
        <span className='text-3'>Horoscope</span>
        <form>
          <div className="form-group">
            <div className="menu-container">
                <button onClick={handleChange} className="btn_text">Your Horoscope</button>
            </div>
          </div>
          <button onClick={handleClick} className="btn_text">Lets go !!</button>
        </form>
      </div>
    </React.Fragment>
  );
};

export default Home;
